import React from "react";

const SingUpUrl="https://localhost:7003/Wish";

async function AddWish(present : string, price : number)
{
  const responseAdd = await fetch(SingUpUrl,
  {
    method: "POST",
    headers:     
    {
      'Accept': 'application/json',
      'Authorization': 'Bearer '+sessionStorage.accessToken,
      'Content-Type': 'application/json'
    },
    body: JSON.stringify({
      present: present,
      price: price
    })
  });

  if(responseAdd.ok)
  {
    console.log(111111)
  }
  console.log(responseAdd.status);
}

const handleSubmit = async (e) => {
  console.log("adsvfdas");
  e.preventDefault();
  if(sessionStorage.accessToken==null)
  {
    console.log("adsvfdas");
    return null
  }

  await AddWish('aaaaaaa', 222);
}

function IndexPaje() 
{
    return (
      <div className="IndexPaje">
        <button type="submit" onSubmit={handleSubmit}>ihoioijioj</button>
      </div>
    );
  }
  
  export default IndexPaje;
